import React, { Component } from 'react'

export default class Person extends Component {
  render() {
    return (
      <div>
        <input ref={c=>this.nameNode=c} type='text' placeholder="enter name"/>
        <input ref={c=>this.ageNode=c} type='text' placeholder="enter age"/>
        <button>add</button>
        <ul>
            <li>name1 -- age1</li>
            <li>name2 -- age2</li>
            <li>name3 -- age3</li>
        </ul>
      </div>
    )
  }
}
